    const [reloadView,setreloadView] = useState(1)

    const Reload = (id)=>{
        console.log(id)
        setreloadView(id) 
    }
    return (
        <div className="container">
            <InputEntry Reload={Reload} />
            <ViewAddress />
        </div>
    )
}

export default Address
